import{_ as t,o as a,c as o,a2 as i}from"./chunks/framework.DV8_IVTo.js";const h=JSON.parse('{"title":"Contributor Covenant Code of Conduct","description":"","frontmatter":{},"headers":[],"relativePath":"code_of_conduct.md","filePath":"code_of_conduct.md","lastUpdated":1765184252000}'),n={name:"code_of_conduct.md"};function r(c,e,s,l,d,p){return a(),o("div",null,[...e[0]||(e[0]=[i('<h1 id="contributor-covenant-code-of-conduct" tabindex="-1">Contributor Covenant Code of Conduct <a class="header-anchor" href="#contributor-covenant-code-of-conduct" aria-label="Permalink to &quot;Contributor Covenant Code of Conduct&quot;">​</a></h1><h2 id="our-pledge" tabindex="-1">Our Pledge <a class="header-anchor" href="#our-pledge" aria-label="Permalink to &quot;Our Pledge&quot;">​</a></h2><p>In the interest of fostering an open and welcoming environment, we as contributors and maintainers pledge to make participation in our project and our community a harassment-free experience for everyone, regardless of age, body size, disability, ethnicity, sex characteristics, gender identity and expression, level of experience, education, socio-economic status, nationality, personal appearance, race, religion, or sexual identity and orientation.</p><h2 id="our-standards" tabindex="-1">Our Standards <a class="header-anchor" href="#our-standards" aria-label="Permalink to &quot;Our Standards&quot;">​</a></h2><p>Examples of behavior that contributes to creating a positive environment include:</p><ul><li>Using welcoming and inclusive language</li><li>Being respectful of differing viewpoints and experiences</li><li>Gracefully accepting constructive criticism</li><li>Focusing on what is best for the community</li><li>Showing empathy towards other community members</li></ul><p>Examples of unacceptable behavior by participants include:</p><ul><li>The use of sexualized language or imagery and unwelcome sexual attention or advances</li><li>Trolling, insulting/derogatory comments, and personal or political attacks</li><li>Public or private harassment</li><li>Publishing others&#39; private information, such as a physical or electronic address, without explicit permission</li><li>Other conduct which could reasonably be considered inappropriate in a professional setting</li></ul><h2 id="our-responsibilities" tabindex="-1">Our Responsibilities <a class="header-anchor" href="#our-responsibilities" aria-label="Permalink to &quot;Our Responsibilities&quot;">​</a></h2><p>Project maintainers are responsible for clarifying the standards of acceptable behavior and are expected to take appropriate and fair corrective action in response to any instances of unacceptable behavior.</p><h2 id="scope" tabindex="-1">Scope <a class="header-anchor" href="#scope" aria-label="Permalink to &quot;Scope&quot;">​</a></h2><p>This Code of Conduct applies within all project spaces, and it also applies when an individual is representing the project or its community in public spaces.</p><h2 id="enforcement" tabindex="-1">Enforcement <a class="header-anchor" href="#enforcement" aria-label="Permalink to &quot;Enforcement&quot;">​</a></h2><p>Instances of abusive, harassing, or otherwise unacceptable behavior may be reported by contacting the project team at [INSERT EMAIL]. All complaints will be reviewed and investigated and will result in a response that is deemed necessary and appropriate to the circumstances. The project team is obligated to maintain confidentiality with regard to the reporter of an incident.</p><h2 id="attribution" tabindex="-1">Attribution <a class="header-anchor" href="#attribution" aria-label="Permalink to &quot;Attribution&quot;">​</a></h2><p>This Code of Conduct is adapted from the <a href="https://www.contributor-covenant.org" target="_blank" rel="noreferrer">Contributor Covenant</a>, version 1.4, available at <a href="https://www.contributor-covenant.org/version/1/4/code-of-conduct.html" target="_blank" rel="noreferrer">https://www.contributor-covenant.org/version/1/4/code-of-conduct.html</a></p>',16)])])}const f=t(n,[["render",r]]);export{h as __pageData,f as default};
